<script lang="ts" setup>
	import { getCurrentInstance, onMounted, reactive, ref } from 'vue';
	import { useStore } from 'vuex'
	import * as PDFLib from 'pdf-lib'
	import { base64ToFile, base64ToPath, bufferToFile, pathToBase64 } from '../../utils/image-tools';
	import { apis, deleteFile, getApiUrl, requestApi, upload } from '../../utils/http';

	const store = useStore()
	const state = reactive({ sign: '', finger: '',signData:'',fingerData:'',rData:{},websrc: '',appUrl:'/hybrid/html/readPdf/index/index.html',title:'文件签名',
	webviewStyles: {
        width: '100%',
      }  })
	onMounted(() => {
		getImages()
