	const instance = getCurrentInstance()
	console.log(instance);
	
	const url = 'https://zwf-1256221573.cos.ap-guangzhou.myqcloud.com/pdf/my.pdf'
	const sign = 'https://zwf-1256221573.cos.ap-guangzhou.myqcloud.com/pdf/logo.png'
	const finger ='https://zwf-1256221573.cos.ap-guangzhou.myqcloud.com/pdf/Finger.png'
	
	const handleMessage = async(evt)=> {
		mergeImageToPdf(state.rData, state.signData, state.fingerData,evt.detail.data[0])
		// if (evt.detail.data[0]?.type === 'reSign') {
		// 	// uni.navigateTo({
