		// }
	}
	async function getImages() {
		try {
			// const url = store.getters.targetDocumentPath
			// const url = "https://zwf-1256221573.cos.ap-guangzhou.myqcloud.com/pdf/my.pdf"
			// const { sign, finger } = store.getters.targetDocumentImages
			state.sign = sign
			state.finger = finger
			// const testImg = '/static/imgs/failure.png'
			// const ps = await Promise.all([uni.request({
			// 	url: '../../static/p3.pdf',
			// 	// url: url,
			// 	responseType: 'arraybuffer',
			// 	complete(r) {
			// 		console.log('file data:', r);
			// 	}
			// }), uni.request({
			// 	url: '../../static/imgs/failure.png',
			// 	responseType: 'arraybuffer',
			// 	complete(r) {
			// 		console.log('sign data:', r);
