			// })])
			getPdfData(url,sign, finger)
		
			
			// instance.proxy.pdf.mergeImageToPdf.apply(instance.proxy, datas)
			// instance.proxy.pdf.$ownerInstance.callMethod('mergeImageToPdf', ...datas)
