	}

	const getPdfData = (url,sign,finger)=>{
		// uni.showLoading()
		uni.request({
			url,
			method: 'GET',
			responseType: 'arraybuffer',
			success: async (r) => {
				try {
					// const [fingerData, signData] = await Promise.all([pathToBase64(sign), pathToBase64(finger)]) 
					// const signData = "data:image/png;base64,"
					// const fingerData = "data:image/png;base64,"
					state.websrc = state.appUrl + '?url=' + encodeURIComponent(url) + '&tname=' +
						encodeURIComponent(
							state.title) + '&signImgUrl=' +
						encodeURIComponent(sign)+ '&fingerUrl=' +
						encodeURIComponent(finger)
						state.rData=r.data
						state.signData = signData
						state.fingerData = fingerData
				} catch (err) {
					// uni.hideLoading()
					// uni.showModal({
					// 	showCancel: false,
					// 	content: '获取文书失败，请重试' + JSON.stringify(err),
					// 	success() {
					// 		uni.navigateBack()
					// 	}
					// })
				}
			},
			fail(err) {
				uni.hideLoading()
				uni.showModal({
					showCancel: false,
					content: '获取文书失败，请重试' + err,
					success() {
						uni.navigateBack()
					}
				})
			}
		})
	}
	async function mergeImageToPdf(fileData, signData, fingerData,resData) {
		uni.showLoading()
		let path = ''
		try {
			const {
				PDFDocument,
				rgb,
				degrees
			} = PDFLib
			const pdfDoc = await PDFDocument.load(fileData)
			const pages = pdfDoc.getPages()
			const lastPage = pages[resData?.signDatas.page_no - 1]
			// lastPage.drawText('This text was added with JavaScript!', {
			// 	x: 5,
			// 	y: height / 2,
			// 	size: 20,
			// 	color: rgb(0.95, 0.1, 0.1),
			// })
			await drawImage(pdfDoc, signData, resData?.signDatas,lastPage)
			await drawImage(pdfDoc,  fingerData, resData?.fingerDatas,lastPage)
			const pdfBytes = await pdfDoc.save()
			path = await bufferToFile(pdfBytes)
			console.log(path,5555)
			await uploadMergedFile(path)
		 	// const r = await upload(path, 'shenwen')
			uni.hideLoading()
			uni.showModal({
				content: '上传成功',
				showCancel: false,
				success() {
					uni.navigateBack()
				}
			})	
		} catch (error) {
			uni.hideLoading()
			uni.showModal({
				showCancel: true,
				confirmText: '打开文书',
				content: '上传文书失败：' + error,
				success(r) {
					if (r.confirm) {
						console.log(path);
						uni.openDocument({
							filePath: path
						})
					} else {
						uni.navigateBack()
					}
				}
			})
		}
	}

	async function drawImage(pdfDoc : PDFLib.PDFDocument, imgData : string, infoData : any,page:PDFLib.PDFPage, isJpg = false) {
		const jpgImage = await (isJpg ? pdfDoc.embedJpg(imgData) : pdfDoc.embedPng(imgData))
		// const jpgDims = jpgImage.scale(0.3)
		// console.log(jpgDims);
		page.drawImage(jpgImage, {
			// x: page.getWidth() - jpgDims.width - 30,
			// y: page.getHeight() * 0.3,
			// width: jpgDims.width,
			// height: jpgDims.height,
			x: infoData.left,
			y: page.getHeight() - infoData.height - infoData.top <0?0:page.getHeight() - infoData.height - infoData.top,
			width: infoData.width,
			height: infoData.height,
		})
	}

	function uploadMergedFile(filePath: string) {
		const { businessId, documentCode, id_num } = store.getters.targetDocumentInfo

		// console.log(file);
		// uni.setClipboardData({
		// 	data: file
		// })
		// return requestApi(apis.uploadFile, { businessId, documentCode, id_num, file}, { token: store.getters.token })
		return new Promise(async (resolve, reject) => {
			const url = `${getApiUrl()}${apis.uploadFile}`
			uni.uploadFile({
				url,
				filePath,
				name: 'file',
				header: { token: store.getters.token },
				formData: { businessId, documentCode, id_num },
				success(r) {
					console.log(r);
					if (r.statusCode === 200) {
						const data = JSON.parse(r.data)
						if (data.code === '0' || data.code === '200') {
							resolve(data)
							deleteFile(filePath);
						} else {
							reject(data.message)
						}						
					} else {
						reject('响应错误码' + r.statusCode)
					}
				},
				fail(err) {
					reject(err)
				}
			})
		})
	}
</script>

